export default function Wears({children, types, isOpen}) {
    
return(
<div className="mt-7 justify-normal rounded-t-md ml-3 rounded-b-2xl items-center text-slate-900 font-semibold bg-fuchsia-500 bg-opacity-20 shadow-2xl w-96 p-5">
    <span className="flex justify-around" > {types} <button className="bg-lime-50 w-20 roun" >Close </button> </span>

    <p>{children} </p>
</div>

)

}
